pragma solidity 0.8.3;

import "@openzeppelin/contracts-upgradeable/token/ERC721/presets/ERC721PresetMinterPauserAutoIdUpgradeable.sol";
import "./abstract/AccessControlledAndUpgradeable.sol";
import "./GEMS.sol";

/** Contract gem collectors can use to mint NFT's representing their gem collecting */

contract GemNFT is ERC721PresetMinterPauserAutoIdUpgradeable {
  // override as NFT's are of one image
  function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
    require(_exists(tokenId), "ERC721Metadata: URI query for nonexistent token");

    string memory baseURI = _baseURI();
    return bytes(baseURI).length > 0 ? string(abi.encodePacked(baseURI)) : "";
  }
}

/** @title GemCollectorNFTMinter */
contract GemCollectorNFTWarden is AccessControlledAndUpgradeable {
  address public gems;

  // users has minted already that nft
  mapping(address => mapping(address => bool)) public hasMinted;

  // NFT's and their min required gems
  mapping(address => uint256) public NFTs;

  event NFTMinted(address user, address nft);
  event NFTAdded(address nft, string name, string ticker, string tokenURI, uint256 minAmount);

  modifier adminOnly() {
    _checkRole(ADMIN_ROLE, msg.sender);
    _;
  }

  function initialize(address _admin, address _gems) public initializer {
    _AccessControlledAndUpgradeable_init(_admin);
    gems = _gems;
  }

  function addNFT(
    string memory name,
    string memory ticker,
    string memory tokenURI,
    uint256 minGems
  ) external adminOnly {
    require(minGems > 1e18, "Gems min requirement too small");
    GemNFT gemNFT = new GemNFT();
    gemNFT.initialize(name, ticker, tokenURI);
    address nft = address(gemNFT);
    NFTs[nft] = minGems;
    emit NFTAdded(nft, name, ticker, tokenURI, minGems);
  }

  function mint(address nft) external {
    require(!hasMinted[msg.sender][nft], "Already minted this nft");

    uint256 userGemsBalance = GEMS(gems).gems(msg.sender);

    // mint nft to msg.sender
    if (userGemsBalance >= NFTs[nft]) {
      hasMinted[msg.sender][nft] = true;
      GemNFT(nft).mint(msg.sender);
      emit NFTMinted(msg.sender, nft);
    }
  }
}
